    return (
        <div>
            <Container className="themed-container" fluid={true}>

                <Row>
                    <Col sm="12">
                        <InputBudget />
                    </Col>
                </Row>
                <br></br>
                <br></br>
                <Row>
                    <DisplayBudget />
                </Row>
            </Container>
        </div>

    )
}

export default Budget;
